import { MantineProvider, Paper, Text, Button } from "@mantine/core";

export default function App() {
  return (
    <MantineProvider
      theme={{
        fontFamily: "Open Sans",
        colorScheme: "dark",
        fontSize: { md: 90 },
      }}
    >
      <Paper>
        <Text>Hello, world!</Text>
      </Paper>
      <Button>My app button</Button>
    </MantineProvider>
  );
}
